import logo from './logo.svg';
import './App.css';
import Post from './Post';
import React , { useState } from 'react';

function App() {
  const [posts,setPosts] = useState([
    {
      username:"Aryama",
      caption:"WOWW",
      imageUrl:"https://weneedfun.com/wp-content/uploads/2016/09/Amazing-Photos-Of-Nature-12.jpg"
    },
    {
      username:"Ananta",
      caption:"Hi , i am new", 
      imageUrl:"https://weneedfun.com/wp-content/uploads/2016/09/Amazing-Photos-Of-Nature-15.jpg"
    }
  ]);

  return (
    <div className="App">


    <div className="app__header">
    <img
     className="app__headerImage"
      src="https://www.instagram.com/static/images/web/mobile_nav_type_logo.png/735145cfe0a4.png"
      alt=""
    />

    </div>

   {
     posts.map(post => (
        <Post username={post.username} caption={post.caption} imageUrl={post.imageUrl} />
     ))
   }
    </div>
  );
}

export default App;
